const { default: RoomInfo } = require("./roominfo/RoomInfo")

const MainPanel = (args) => {
    const { currentRoom } = args;
    return <RoomInfo props={{name: currentRoom, people: ['Ryan Gonzalez', 'Cathleen', 'Grover', 'Abdul', 'Dude']}}></RoomInfo>
}

export default MainPanel;
